goog.provide("goog.ui.TwoThumbSliderTest");goog.setTestOnly("goog.ui.TwoThumbSliderTest");goog.require("goog.testing.jsunit");goog.require("goog.ui.SliderBase");goog.require("goog.ui.TwoThumbSlider");var slider;function tearDown(){goog.dispose(slider)}function testGetCssClass(){slider=new goog.ui.TwoThumbSlider;assertEquals("goog-twothumbslider-horizontal",slider.getCssClass(goog.ui.SliderBase.Orientation.HORIZONTAL));assertEquals("goog-twothumbslider-vertical",slider.getCssClass(goog.ui.SliderBase.Orientation.VERTICAL))}